import React, { Component } from 'react'
import "../App.css"

export default class Welcome extends Component {
    render() {
        return (
            <section style={welcomestyle}>
               <h1 className="text-danger">hello</h1>
            </section>
        )
    }
}
const welcomestyle = {
    position:"relative"
}
